credentials:
  system:
    domainCredentials:
    - credentials:
      - gitlabPersonalAccessToken:
          description: "antxon@gitlab"
          id: "ac16ea3b-15b7-4e49-bf34-b5938e94c966"
          scope: GLOBAL
          token: "{AQAAABAAAAAg+kUYMGJZmjybmBlsvtfVFiefIetEonq00BaoM+gztKajcgIUUm/jBqpKNrbZ34b4}"
      - basicSSHUserPrivateKey:
          description: "jenkins@mountain"
          id: "56fb49f3-aad9-42e4-939f-387220e4304f"
          privateKeySource:
            directEntry:
              privateKey: "{}"
          scope: GLOBAL
          username: "git"
jenkins:
  agentProtocols:
  - "JNLP4-connect"
  - "Ping"
  authorizationStrategy:
    loggedInUsersCanDoAnything:
      allowAnonymousRead: false
  crumbIssuer:
    standard:
      excludeClientIPFromCrumb: false
  disableRememberMe: false
  labelAtoms:
  - name: "master"
  markupFormatter: "plainText"
  mode: NORMAL
  myViewsTabBar: "standard"
  numExecutors: 2
  primaryView:
    all:
      name: "all"
  projectNamingStrategy: "standard"
  quietPeriod: 5
  remotingSecurity:
    enabled: true
  scmCheckoutRetryCount: 0
  securityRealm:
    local:
      allowsSignup: false
      enableCaptcha: false
      users:
      - id: "antxon"
        name: "antxon"
        properties:
        - "myView"
        - preferredProvider:
            providerId: "default"
        - "timezone"
        - mailer:
            emailAddress: "agoca80@gmail.com"
        - "apiToken"
        - favoriting:
            autofavoriteEnabled: true
        - "favorite"
  slaveAgentPort: -1
  updateCenter:
    sites:
    - id: "default"
      url: "https://updates.jenkins.io/update-center.json"
  views:
  - all:
      name: "all"
  viewsTabBar: "standard"
security:
  apiToken:
    creationOfLegacyTokenEnabled: false
    tokenGenerationOnCreationEnabled: false
    usageStatisticsEnabled: true
  sSHD:
    port: -1
unclassified:
  bitbucketEndpointConfiguration:
    endpoints:
    - bitbucketCloudEndpoint:
        enableCache: false
        manageHooks: false
        repositoriesCacheDuration: 0
        teamCacheDuration: 0
  buildDiscarders:
    configuredBuildDiscarders:
    - "jobBuildDiscarder"
  buildStepOperation:
    enabled: false
  email-ext:
    adminRequiredForTemplateTesting: false
    allowUnregisteredEnabled: false
    charset: "UTF-8"
    debugMode: false
    defaultBody: |-
      $PROJECT_NAME - Build # $BUILD_NUMBER - $BUILD_STATUS:

      Check console output at $BUILD_URL to view the results.
    defaultContentType: "text/plain"
    defaultSubject: "$PROJECT_NAME - Build # $BUILD_NUMBER - $BUILD_STATUS!"
    defaultTriggerIds:
    - "hudson.plugins.emailext.plugins.trigger.FailureTrigger"
    mailAccount:
      smtpPassword: "{AQAAABAAAAAQL42FOCd5L23eF18bhI6hhvEp1hym0WNNgtNm8lV/Cgg=}"
    maxAttachmentSize: -1
    maxAttachmentSizeMb: -1
    precedenceBulk: false
    watchingEnabled: false
  fingerprints:
    fingerprintCleanupDisabled: false
    storage: "file"
  gitHubConfiguration:
    apiRateLimitChecker: ThrottleForNormalize
  gitHubPluginConfig:
    hookUrl: "http://192.168.1.4:8080/github-webhook/"
  gitLabServers:
    servers:
    - credentialsId: "ac16ea3b-15b7-4e49-bf34-b5938e94c966"
      name: "default"
      secretToken: "{AQAAABAAAAAQ5B9iKQ31Q16e2PaEOKoH86wYrhXqx/ZRQJF0Rl9gOBw=}"
      serverUrl: "http://192.168.1.10"
  gitSCM:
    addGitTagAction: false
    allowSecondFetch: false
    createAccountBasedOnEmail: false
    disableGitToolChooser: false
    hideCredentials: false
    showEntireCommitSummaryInChanges: false
    useExistingAccountWithSameEmail: false
  globalLibraries:
    libraries:
    - defaultVersion: "master"
      implicit: true
      name: "shared-pipeline-library"
      retriever:
        modernSCM:
          scm:
            gitlab:
              credentialsId: "56fb49f3-aad9-42e4-939f-387220e4304f"
              id: "32ef7fb7-5e4d-4a83-abf1-64c5749f079a"
              serverName: "default"
              traits:
              - gitLabBranchDiscovery:
                  strategyId: 1
              - originMergeRequestDiscoveryTrait:
                  strategyId: 1
              - gitLabForkDiscovery:
                  strategyId: 1
                  trust: "gitLabTrustPermissions"
  junitTestResultStorage:
    storage: "file"
  location:
    adminAddress: "address not configured yet <nobody@nowhere>"
    url: "http://192.168.1.4:8080/"
  mailer:
    charset: "UTF-8"
    useSsl: false
    useTls: false
  pollSCM:
    pollingThreadCount: 10
  timestamper:
    allPipelines: false
    elapsedTimeFormat: "'<b>'HH:mm:ss.S'</b> '"
    systemTimeFormat: "'<b>'HH:mm:ss'</b> '"
tool:
  git:
    installations:
    - home: "git"
      name: "Default"
  mavenGlobalConfig:
    globalSettingsProvider: "standard"
    settingsProvider: "standard"